include 'diff_oop.php';

session_start();
#Inserire base modulo, base potenza
do {
    $n_primo = rand(1, 100);
    $n_base = rand(1, 100);

    $alice = new Actor($n_primo, $n_base);
    $bob = new Actor($n_primo, $n_base);

    $alice->getKey($bob->send());
    $bob->getKey($alice->send());

    $alice->session();
    $bob->session();
    $_SESSION['sessione'] = $alice->get_session();
    $_SESSION['alice'] = $alice->get_segreto();
    $_SESSION['bob'] = $bob->get_segreto();

}while($alice->get_excange() == $bob->get_excange() || $bob->get_excange() <= 0 || $alice->get_excange() <= 0 || $bob->get_excange() == $bob->get_segreto() || $alice->get_excange() == $alice->get_segreto());


    print_r($alice);
?>

